import React from "react";
import './part.css'
import { partdata } from "../../Data/partner";
const Part = () => {
    return ( 
        <div className="partner-container">
            <div className="partner-container-in">
                {partdata.map((partner))}
                <div className="com-group" key={partdata.id} >
                    <div className="com">
                        logo
                    </div>
                </div>
            </div>
        </div>
     );
}

export default Part;
